import "./static/css/header.css";
import { Link } from "react-scroll";

const Header = () => {
  return (
    <div id="header">
      <nav className="navbar fixed-top navbar-expand-lg navbar-dark bg-dark sty">
        <div className="navbar-brand ms-2"></div>
        <Link
          // className="nav-link"
          activeClass="active"
          to="home"
          spy={true}
          smooth={true}
          offset={50}
          duration={300}
          // onSetActive={this.handleSetActive}
        >
          Porfolio
        </Link>

        <div className="collapse navbar-collapse" id="navbarNavDropdown">
          <ul className="navbar-nav ms-auto me-2 sty">
            <li className="nav-item active">
              <Link
                className="nav-link"
                activeClass="active"
                to="intro"
                spy={true}
                smooth={true}
                offset={50}
                duration={300}
                // onSetActive={this.handleSetActive}
              >
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link"
                activeClass="active"
                to="projects"
                spy={true}
                smooth={true}
                offset={50}
                duration={300}
                // onSetActive={this.handleSetActive}
              >
                Projects
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link"
                activeClass="active"
                to="skills"
                spy={true}
                smooth={true}
                offset={50}
                duration={300}
                // onSetActive={this.handleSetActive}
              >
                Skills
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link"
                activeClass="active"
                to="exp"
                spy={true}
                smooth={true}
                offset={50}
                duration={300}
                // onSetActive={this.handleSetActive}
              >
                Experience
              </Link>
            </li>
            <li className="nav-item">
              <Link
                className="nav-link"
                activeClass="active"
                to="contact"
                spy={true}
                smooth={true}
                offset={50}
                duration={300}
                // onSetActive={this.handleSetActive}
              >
                Contact
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
};

export default Header;
